import { View, Text,Image,StyleSheet } from 'react-native'
import React from 'react'

export default function Images() {
  return (
    <View>
      <Text>Images</Text>
      <Image
      style={styles.imgStyle}
      source={require("../../assets/Img1.jpg")}
      />
    </View>
  )
}


const styles= StyleSheet.create({
    imgStyle:{
        height:"auto",
        width:"auto"
    }
})
